import useFormulario from './hooks/useFormulario'
import Input from './components/Input'
import Card from './components/Card'

function App() {
  const initialState = {
    name:'',
    lastName:'',

  }
  const [formulario,handleChange] = useFormulario(initialState);

  return (
    <Card>    
      <form>
        <Input
          label='Nombre '
          name='name'
          placeholder='Nombre'
          value={formulario.name}
          onChange={handleChange}
        />
          <Input
          label='Apellido '
          name='lastName'
          placeholder='Apellido'
          value={formulario.lastName}
          onChange={handleChange}
        />
      </form>
    </Card>
  );
}

export default App;
